pragma solidity >=0.5.0;

import "./ECDSA.sol";

import "./RelayRecipient.sol"; 

// TODO: Add credits for users to use gashub
contract Inui is RelayRecipient {
    using ECDSA for bytes32;

    struct Idea {
        bytes32 root;    // where this idea was forked from
        bytes32 documentHash;   // sha3(raw text)
        address creator;
        string category;
    }

    address public owner;


    mapping (bytes32 => Idea) public ideas;   // key = original hash


    bytes32[] public ideaList;



    constructor(address hubAddress)
    public {
        owner = msg.sender; 
        init_relay_hub(RelayHub(hubAddress));
    }

    function submitData(bytes32 documentHash, string memory category, string memory ipfsHash)
    public {
        Idea storage newIdea = ideas[documentHash];
        require(documentHash != bytes32(0)); 
        require(!alreadyExists(documentHash), "HASH ALREADY EXISTS");
        newIdea.documentHash = documentHash;
        newIdea.creator = get_sender(); 
        newIdea.category = category;
        ideaList.push(documentHash);
        emit DataSubmitted(get_sender(), documentHash, category, ipfsHash);
    }

    function viewed(address user, bytes32 documentHash, bytes memory signature)
    public
    view
    returns (bool){
        require(alreadyExists(documentHash), "HASH DOESNT EXIST");
        return user == documentHash.toEthSignedMessageHash().recover(signature);
    }

    function whoSigned(bytes32 documentHash, bytes memory signature)
    public
    view
    returns (address) {
        require(alreadyExists(documentHash), "HASH DOESNT EXIST");
        return documentHash.toEthSignedMessageHash().recover(signature);
    }

    function accept_relayed_call(address relay, address from, bytes memory encoded_function, uint gas_price, uint transaction_fee) 
    public 
    view 
    returns(uint32) {
        return 0;
    }

    function post_relayed_call(address relay, address from, bytes memory encoded_function, bool success, uint used_gas, uint transaction_fee) 
    public {
        // TODO: subtract user credits
    }

    function getEthSignedMessage(bytes32 documentHash)
    public 
    pure 
    returns (bytes32){
        return documentHash.toEthSignedMessageHash();
    }

    function alreadyExists(bytes32 docHash)
    public
    view
    returns (bool) {
        return (ideas[docHash].creator != address(0));
    }

    function getIdeaInfo(bytes32 originalHash)
    public 
    view 
    returns (bytes32, address, string memory) {
        return (ideas[originalHash].documentHash, ideas[originalHash].creator, ideas[originalHash].category);
    }

    function getIdeaList()
    public 
    view 
    returns (bytes32[] memory) {
        return ideaList; 
    }

    function numberOfMessages()
    public 
    view 
    returns (uint256) {
        return ideaList.length;
    }

    event DataSubmitted(address indexed creator, bytes32 indexed documentHash, string category, string ipfs);
}
